      bottom = Math.ceil(lastLabelDim.height / 2)
      width =
        Math.max(tickSizeInner, tickSizeOuter) + // Add tick size
        tickPadding + // Add tick padding
        // Add the width of the largest label
        Math.max(0, ...labelDims.map(d => Math.ceil(d.width)))
    }

