    axisDimensions,
    gridHeight,
    gridWidth,
    id,
    labelRotationStep,
    maxLabelRotation,
    maxTickCount,
    minTickCount,
    position,
    rotation,
    setChartState,
    tickCount,
    tickPadding,
    tickSizeInner,
    tickSizeOuter,
    type,
    vertical,
  ])

