    axisPath = `
        M 0, ${tickSizeOuter}
        V 0
        H ${range1}
        V ${tickSizeOuter}
      `
  } else {
    axisPath = `
        M 0, ${-tickSizeOuter}
        V 0
        H ${range1}
        V ${-tickSizeOuter}
              `
  }

  let showGridLine
  if (typeof showGrid === 'boolean') {
    showGridLine = showGrid
  } else if (type === axisTypeOrdinal) {
    showGridLine = false
  } else {
    showGridLine = true
  }

  // Combine default styles with style props
  const axisStyles = {
    ...defaultStyles,
    ...styles,
  }

  return (
    <Group
      ref={elRef}
      className="Axis"
      style={{
        pointerEvents: 'none',
        transform:
          position === positionRight
            ? Utils.translateX(gridWidth)
            : position === positionBottom
            ? Utils.translateY(gridHeight)
            : undefined,
      }}
