            tooltipDims.height,
          centeredFromLeft: space.left > tooltipDims.width / 2,
          centeredFromRight: space.right > tooltipDims.width / 2,
          centeredFromTop: space.top > tooltipDims.height / 2,
          centeredFromBottom: space.bottom > tooltipDims.height / 2
